import './App.css';
import Home  from "./pages/Home";
import { BrowserRouter as Router,Route,Routes  } from "react-router-dom";
function App() {

  return (
    <div className="App">
     <Router>
      <Routes >
        <Route path="/" exact component={<Home/>} />
      </Routes >
     </Router>
    </div>
  );
}

export default App;
